IF YOU ARE LOOKING TO SUCCEED IN THE GYM, YOU MUST STICK TO THE PLAN! 

The body is a wonderful machine. Doing random workouts you see on social media is cool and fun to do! But when it comes to..

“I can’t progress” or “my form is bad” or the ol “It hurts to do that”

Come up with a 6-8 week plan that will target and help improve what you are struggling with! 1 workout is not enough. YouTube university is free! There is a trainer every other post on instagram. 

It isn’t always fun, and it can get repetitive. But bouncing between styles of training, rep ranges and volume / intensity, will not help you as much STICKING TO THE PLAN. THEN ADJUST & EXECUTE. 

@saraahcashman with the form check and the glute pump 🍑

Dm me to start your journey today! 

